import React from 'react';

function StockPricingCard() {
    return (
        <>
            <div className = "card-body">
                <h5 className = "card-title">股票定價策略詳細清單</h5>
                <p className = "card-text">請選擇定價方法、股票代號以及參數</p>

            </div>
        </>
    );
}

export default StockPricingCard;
